.mo-module {
    .modal-footer {
        button.btn-secondary {
            display: none;
        }
    }
}
.fade-enter{
  opacity:0;
}
.fade-enter-active{
  transition:opacity .3s;
}
.fade-leave-active{
  transition:transform .3s;
}

#popup-edit {
    width: 100%;
    height: 100%;
    position: fixed;
    left: 0;
    top: 0;
    z-index: 2222;

    .popup-content {
        width: 100%;
        position: fixed;
        z-index: 10;
        transform: translateX(-50%);
        left: 50%;
        top: 25%;
    }

    .bg {
        width: 100%;
        height: 100%;
        position: fixed;
        left: 0;
        top: 0;
        background: rgba(10,53,68,.5);
        z-index: 8;
    }
}
